import React from "react";
import { Link } from "react-router-dom";
import logo from "../images/"

const Navbar = () => {
  return <div>
    <nav>
      <div></div> 
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
      </ul>
    </nav>
  </div>;
};

export default Navbar;
